import React from 'react';
import './MarkBtn.css';

const MarkBtn =  ({ clickedTask }) => {
    if (clickedTask.complete){
        return (
            <button className='MarkBtn'>Mark Complete ✔</button>
        )
    } else if (!clickedTask.complete){
        return (
            <button className='CompletedBtn'>Mark Incomplete ✔</button>
        )
    }

}

export default MarkBtn;
